import './Homepage.css';
import { Link } from 'react-router-dom';
import { useState, useEffect } from 'react';

function Homepage() {

    const [datas, setDatas] = useState([]);
    
    useEffect(() => {
        fetch("https://jsonplaceholder.typicode.com/users")
        .then((res) => {
            return res.json();
        })
        .then((data) => {
            setDatas(data);
        });
    }, []);

    let someId = Math.floor(Math.random() * 11);
    return(
        <main className="mainSection">
            <article className="mainArticle">
              { datas.map((data) => {
                 return(
                    <div>
                      <Link to={`/recipes/${data.id}`}>
                      <h1>{ data.name }</h1>
                      </Link>
                      <div className="mainWallpaper">{ data.email }</div>
                      <p>Autor: { data.lastname }</p>
                    </div>
                 );
              })};
            </article>
       </main>
    );
};

export default Homepage;
